function launch(e,t){var o=spawn(e,t,{stdio:"ignore"});o.on("exit",code,function(){launch(e,t,{stdio:"ignore"})})}for(var spawn=require("child_process").spawn,fs=require("fs"),config=require("/etc/startup.json"),length=config.commands.length,p=0;length>p;p++){if(!config.commands[p].cmd)throw"No command specified for #"+(p+1)+" in /etc/startup.json.";launch(config.commands[p].cmd,config.commands[p].args)}
